import React, { useEffect, useState } from 'react';


function App(){

  const [num , setnum] = useState(0)

  useEffect(function (){
    document.title= `You Clicked me ${num} Times`;
  })

  function increment(){
    setnum(num + 1);
  }


  return(
    <>
      <button onClick={increment}>Click me {num}</button>
    </>
  )
}

export default App;
